class Solution:
    def __init__(self, N: int):
        self.N = N
        self.relationships = 0

    def explore(self, current_characters: list, remaining_characters: list):
        if len(current_characters) < 2:
            return

        for i in range(len(remaining_characters)):
            current_character = current_characters[i]
            remaining_characters.remove(current_character)

            remaining_relationships = self.explore(current_characters[:i] + current_characters[i+1:], remaining_characters)
            if remaining_relationships > 0:
                self.relationships += remaining_relationships * (len(current_characters) + 1)
            else:
                self.relationships += len(current_characters)

            remaining_characters.append(current_character)
            remaining_characters.sort()

        return self.relationships

    def solve(self) -> str:
        return str(self.explore([i for i in range(self.N)], [i for i in range(self.N)]))

